import * as React from 'react';
import Box from '@mui/material/Box';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import Modal from '@mui/material/Modal';
import { IconButton } from '@mui/material';
import CloseIcon from '@mui/icons-material/Close';

const style = {
    position: 'absolute',
    top: '50%',
    left: '50%',
    transform: 'translate(-50%, -50%)',
    width: 600,
    bgcolor: 'background.paper',
    border: 'none',
    outline: 'none',
    boxShadow: 24,
    boxRadius: 4,
    p: 4,
};

export default function SubscriptionModel() {
    const [open, setOpen] = React.useState(false);
    const [plan, setPlan] = React.useState("Annually");
    const handleOpen = () => setOpen(true);
    const handleClose = () => setOpen(false);

    return (
        <div>
            <Button onClick={handleOpen}>Open modal</Button>
            <Modal
                open={true}
                onClose={handleClose}
                aria-labelledby="modal-modal-title"
                aria-describedby="modal-modal-description"
            >
                <Box sx={style}>
                    <div className="flex items-center space-x-3">
                        <IconButton onClick={handleClose} aria-label='delete'>
                            <CloseIcon />
                        </IconButton>
                        <div className='flex justify-center py-10'>
                            <div className="w-[80%] space-y-10">
                                <div className="p-5 rounded-md flex items-center justify-between bg-slate-400 shadow-lg">
                                    <h1 className='text-xl pr-5'>Lorem ipsum dolor sit amet consectetur adipisicing elit. Iusto sequi voluptas laudantium, quas officiis nulla at pariatur omnis, sint impedit a facilis, consequatur corrupti blanditiis. Eos sequi tenetur laudantium nisi!</h1>
                                    <img className='w-24 h-25' src='https://www.google.com/imgres?q=verification%20logo&imgurl=https%3A%2F%2Fcdn-icons-png.flaticon.com%2F512%2F7641%2F7641727.png&imgrefurl=https%3A%2F%2Fwww.flaticon.com%2Ffree-icon%2Fverified_7641727&docid=IBUgIrCrXgvvlM&tbnid=ujwnosRsYTM5wM&vet=12ahUKEwigs828jbuIAxX0yzgGHWL1KCUQM3oECBkQAA..i&w=512&h=512&hcb=2&ved=2ahUKEwigs828jbuIAxX0yzgGHWL1KCUQM3oECBkQAA' />
                                </div>
                                <div className="flex justify-between border rounded-full px-5 py-3">

                                    <div>
                                        <span onClick={() => setPlan("Annualy")} className={`${plan === "Annuanly" ? "text-black" : "text-gray-400"} cursor-pointer`} >Annually</span>
                                        <span className='text-green-500 text-sm'>save 12%</span>
                                    </div>
                                    < p className={`${plan === "monthly" ? "text-black" : "text-gray-400"} cursor-pointer`}>Monthly</p>
                                </div>

                            </div>

                        </div>
                    </div>

                </Box>
            </Modal>
        </div >
    );
}
